Ko taea kohinga raraunga Tūaritia, a i roto i te heke mai, ka pea ngā hangarau me te whai wāhitanga hāngū. Ka rite ki eBird whakaatu, e taea te whakamahi kohinga raraunga tohaina mō te rangahau pūtaiao. I tua atu, E whakaatu ana PhotoCity e he pea solvable raruraru e pā ana ki te tīpako me te kounga raraunga. Nahea tohaina mahi kohinga raraunga mō te rangahau pāpori? He tauira faahiahia mai i te mahi o Susan Watkins me ona hoa ki runga ki te Malawi ngā Hautaka Project (Watkins and Swidler 2009; 
..........
aunga tohaina. Roto i te tikanga ki te hanga anō koutou pūmanawa, Ripanga 5.3 whakaatu atu tauira o te kohinga raraunga tohaina mō te rangahau pāpori. Kua whai wāhi katoa o te tauira whakaahuatia i roto i tēnei wāhanga whai wāhi mātātoa: kairīpoata patohia kōrero e rongo ratou; tukuake birders ratou arowhai titi ana; ranei tukuake kaitākaro ratou whakaahua. he aha Otiia ki te i aunoa i te whai wāhitanga, me te kore i rapua e tetahi pūkenga motuhake wa ranei ki te tuku? Ko tenei te kupu whakaari
